import React, { useState } from "react";
import { clients } from "../";

function FiltreCA() {
  const [minCA, setMinCA] = useState(0);
  const filteredClients = clients.filter((client) => client.CA >= minCA);

  return (
    <div>
      <h2>Filtrer par CA</h2>
      <input
        type="number"
        placeholder="Min CA"
        value={minCA}
        onChange={(e) => setMinCA(Number(e.target.value))}
      />
      <ul>
        {filteredClients.map((client) => (
          <li key={client.id}>
            {client.nom} - {client.ville} - CA: {client.CA}
          </li>
        ))}
      </ul>
    </div>
  );
}
export default FiltreCA;
